ಒಂದು ಆಯತಾಕಾರದ ಮೈದಾನವನ್ನು ಕ್ರೀಡಾ ಪಥದೊಳಗೆ ಮುಚ್ಚಲಾಗಿದೆ, ಕೆಳಗಿನಂತೆ ತೋರಿಸಲಾಗಿದೆ. ಪಥವು ಮೈದಾನದ ಎರಡು ಅಂಚುಗಳು ಮತ್ತು ಎರಡು ಅರ್ಧವೃತ್ತಗಳನ್ನು ಹೊಂದಿದೆ. ಪಥದ ಉದ್ದ 400 ಮೀಟರ್. ಮೈದಾನದ ಅತಿದೊಡ್ಡ ಸಾಧ್ಯವಾದ ವಿಸ್ತೀರ್ಣ ಎಷ್ಟು, ಚದರ ಮೀಟರ್‌ಗಳಲ್ಲಿ?

[asy]
unitsize(1 cm);

filldraw((0,0)--(3,0)--(3,2)--(0,2)--cycle,lightgreen);
draw((0,0)--(3,0),linewidth(2*bp));
draw((0,2)--(3,2),linewidth(2*bp));
draw(arc((3,1),1,-90,90),linewidth(2*bp));
draw(arc((0,1),1,90,270),linewidth(2*bp));
[/asy]

